CREATE TABLE test_member (
	idx INT,
	name VARCHAR(50),
	birth DATE,
	city VARCHAR(50),
	gender VARCHAR(50),
	join_dt DATE,
	mail VARCHAR(50),
	login_ip VARCHAR(20),
	primary key (idx)
);

CREATE TABLE test_member_updated (
    seq INT NOT NULL AUTO_INCREMENT,
    idx INT,
    name VARCHAR(50),
    birth DATE,
    city VARCHAR(50),
    gender VARCHAR(50),
    join_dt DATE,
    mail VARCHAR(50),
    login_ip VARCHAR(20),
    CREATED_BY         CHARACTER VARYING(50),
    CREATED_DATE       TIMESTAMP,
    LAST_MODIFIED_BY   CHARACTER VARYING(50),
    LAST_MODIFIED_DATE TIMESTAMP,
    STATUS VARCHAR(50)
);

create sequence mybatis_sequence_generator;


